import React, { useState, useEffect } from 'react';
import axios from 'axios';

function CustomersList() {
  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/customers')
      .then(response => {
        setCustomers(response.data);
      })
      .catch(error => {
        console.error('Błąd podczas pobierania danych klientów:', error);
      });
  }, []);

  return (
    <div>
      <h2>Lista Klientów (Customers)</h2>
      <table style={{ borderCollapse: 'collapse', width: '100%' }}>
        <thead>
          <tr>
            <th style={thStyle}>ID</th>
            <th style={thStyle}>Imię</th>
            <th style={thStyle}>Nazwisko</th>
            <th style={thStyle}>Miasto</th>
            <th style={thStyle}>Ulica</th>
            <th style={thStyle}>Email</th>
          </tr>
        </thead>
        <tbody>
          {customers.map(customer => (
            <tr key={customer.klient_id}>
              <td style={tdStyle}>{customer.klient_id}</td>
              <td style={tdStyle}>{customer.imie}</td>
              <td style={tdStyle}>{customer.nazwisko}</td>
              <td style={tdStyle}>{customer.miasto}</td>
              <td style={tdStyle}>{customer.ulica}</td>
              <td style={tdStyle}>{customer.email}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

const thStyle = {
  border: '1px solid #ddd',
  padding: '8px',
  backgroundColor: '#f2f2f2',
  fontWeight: 'bold'
};

const tdStyle = {
  border: '1px solid #ddd',
  padding: '8px'
};

export default CustomersList;
